import React from 'react';
import styles from './styles/AvailabilityNo.module.css'

const AvailabilityNo = () => {
    return (
        <div className={styles.aviabilityNo__container}>
            Запчасти нет в наличии
        </div>
    );
};

export default AvailabilityNo;
